import 'package:dio/dio.dart';
import 'package:flutter/material.dart';
import 'package:flutter_dotenv/flutter_dotenv.dart';
import 'package:loader_overlay/loader_overlay.dart';
import 'package:mobile/core/constants/error/alert_web_view_error.dart';
import 'package:mobile/core/constants/navigation/navigation_constant.dart';
import 'package:mobile/core/extensions/context_extension.dart';
import 'package:mobile/core/network/dio/dio_client.dart';
import 'package:mobile/core/network/dio/endpoints.dart';
import 'package:mobile/models/web_view_bio_public_identify_model.dart';
import 'package:mobile/routes/router/router.dart';

class BioPublicIdentify {
  static final BioPublicIdentify _instance = BioPublicIdentify._init();
  static BioPublicIdentify get instance => _instance;
  Future<BioPublicIdentifyModel> biometricPublicIdentify(
      BuildContext ctx, String image) async {
     var data = {
      "ctoken": ctx.webViewPr.cToken,
       "photo":"data:image/jpeg;base64,"  +  image
        //"data:image/jpeg;base64," + _image
    };
    var header = {"Authorization": "Bearer ${ctx.webViewPr.oauth}"};
    try {
      final response = await DioClient.instance.post(
      Endpoints.wsO2DomainProd +  Endpoints.bioMyIdPublicIdentify,
      //  "https://dbo.hamkorbank.uz/" + dotenv.env["bioPublic"]!,
          data: data,
          options: Options(headers: await header));
      BioPublicIdentifyModel _data =
          await BioPublicIdentifyModel.fromJson(response);
      if (_data.errorCode == 0) {
        ctx.webViewPr.cToken = _data.data!.ctoken!;
        String toLounch = _data.data!.redirectUrl! +
            "?ctoken=" +
            _data.data!.ctoken! +
            "&oauth=" +
            ctx.webViewPr.oauth;
        
        
        ctx.loaderOverlay.hide();
        NavigationService.instance.pushNamed(
            routeName: NavigationConst.VIEW_ADD_CARD_WEB_PAGE,
            data: Uri.parse(toLounch));
        return _data;
      } else {
        NavigationService.instance.pushNamed(
            routeName: NavigationConst.VIEW_ADD_CARD_WEB_PAGE,
            data: Uri.parse(ctx.webViewPr.failureUrl));
        return throw Exception("Eror");
      }
    } catch (e) {
      ctx.loaderOverlay.hide();
    
      
      if (e is DioError) {
        
        
        ErrorWebView.instance.errorWebView(e.response!.data["error_code"], ctx,url: Uri.parse(ctx.webViewPr.failureUrl));
      }
      throw e;
    }
  }

  BioPublicIdentify._init();
  String _image = "data:image/jpeg;base64," +
      "";
}
